import { ComponentFixture, TestBed } from "@angular/core/testing";
import { SupplierComponent_Admin } from "./supplier.component";

describe('SupplierComponent_Admin', () => {
  let component: SupplierComponent_Admin;
  let fixture: ComponentFixture<SupplierComponent_Admin>;

  beforeEach(async () => {
    await TestBed.configureTestingModule({
      declarations: [ SupplierComponent_Admin ]
    })
    .compileComponents();
  });

  beforeEach(() => {
    fixture = TestBed.createComponent(SupplierComponent_Admin);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

  it('should create', () => {
    expect(component).toBeTruthy();
  });
});
